  \"2013-03-15T14:36:51.423865\",\n\t\"name\": \"elevationdem-dem10m\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset is derived from the multi-resolution
  National Elevation Dataset (NED), at resolutions of both 1/3 arc-second (approx.
  10 meters) and in limited areas, 1/9 arc-second (approx. 3 meters). Contours derived
  from this data may appear to have u0093shiftedu0094 when compared to the 7.5 minute
  USGS Quad Maps, i.e., Digital Raster Graphics, for a variety of reasons: 1) The
  NED is a multi-resolution dataset, e.g., areas with LiDAR source data have superseded
  the original \"quad\" contours; 2) A result of the original contour vectors undergoing
  a NAD27 to NAD83 conversion, then the contour vector-to-raster resampling that produced
  the initial grid, followed by a resampling of that initial 10m grid to the 1/3 arc-second
  NED (~10.29m) and finally the raster-to-vector conversion yielding the current contours.
  VCGI extracted the Vermont portion of the NED and re-projected into Vermont State
  Plane Meters NAD83 (vertical units in feet). Production artifacts were filtered
  out of this source data prior to acquisition resulting in a much-improved base of
  elevation data for calculating contours, slope and hydrologic derivatives. The NED
  is the primary elevation data product produced and distributed by the USGS. The
  NED provides the best available public domain raster elevation data of the conterminous
  United States, Alaska, Hawaii, and territorial islands in a seamless format. The
  NED is derived from diverse source data, processed to a common coordinate system
  and unit of vertical measure. The source data are distributed in geographic coordinates
  in units of decimal degrees, and in conformance with the North American Datum of
  1983 (NAD 83). The source elevation values are provided in units of meters, and
  are referenced to the North American Vertical Datum of 1988 (NAVD 88) over the conterminous
  United States. The NED is updated on a nominal two month cycle to integrate newly
  available, improved elevation source data.\",\n\t\"license_title\": null,\n\t\"extras\":
